            								elseif operacao.tipo == "subtracao" then
            									mult = -1;
            								elseif operacao.tipo == "soma" then
            									mult = 1;
            								elseif operacao.tipo == "imediato" then
            									maximo = maximo + operacao.valor;
            									media = media + operacao.valor;
            								end;
            							end;
            							local mesa = Firecast.getMesaDe(sheet);
